import { Component } from "react";
import gem from './assets/gem.png';
import ".?ButtonBlur.css";

class ButtonBlur extends Component{
    render(){
        return <div className="ButtonBlur">
            <img src={gem}/>
        </div>
    }
}
export default ButtonBlur
